import React from 'react';

const PhoneList = props => {
	const shortNumbers = props.shortNumbers.map(shortNumber => {
		return (
			<Table.Row>
				<Table.Cell>{shortNumber.id}</Table.Cell>
				<Table.Cell>{shortNumber.number}<i class="ellipsis vertical icon"></i></Table.Cell>
				<Table.Cell>
					{shortNumber.short_number}
					{console.log(shortNumber.short_number)}
					{shortNumber.short_number !== undefined ? <i class="ellipsis vertical icon"></i> : null}</Table.Cell>
			</Table.Row>
		);
	});

	return (
		<div>{shortNumbers}</div>
	);
};

export default PhoneList;

const TableExampleCollapsing = () => (
	<Table collapsing>
		<Table.Header>
			<Table.Row>
				<Table.HeaderCell>Name</Table.HeaderCell>
				<Table.HeaderCell>Status</Table.HeaderCell>
				<Table.HeaderCell>Notes</Table.HeaderCell>
			</Table.Row>
		</Table.Header>
		<Table.Body>
			{shortNumbers}
		</Table.Body>
	</Table>
)

